import React from 'react';
import Accueil from './Accueil';

const CardContainer = () => {

    return (
        <>

        <div className="cardContainer">
            <div className="row">
                <div className="col-sm-12 col-md-3">
                    <Card />
                </div>
                </div>
        </div>
        </>

    );
};

export default CardContainer;
